import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Nav from './Common/Nav';




export default function Skills() {
    const handleLogout = () => {
        sessionStorage.removeItem('Auth Token');
        navigate('/login')
    }
    let navigate = useNavigate();
    useEffect(() => {
        let authToken = sessionStorage.getItem('Auth Token')
        console.log(authToken)
        if (authToken) {
            navigate('/skills')
        }

        if (!authToken) {
            navigate('/login')
        }
    }, [])
    return (
        <div>

            Skills Page
            <Nav />
            <button className='logoutbutton' onClick={handleLogout}>Log out</button>
            <div className="skillsBox">
                <div className="ComponentTitle"><h1>Skills</h1></div>
                <div className="skillsColumns">
                    <div className="skillsColumn listArea">
                        <h4>Insert skills</h4>
                        <SkillsDropdown list='listOfSkills' setList='setListOfSkills' purpose="skills"/>
                        <SkillsList list={listOfSkills} setList={setListOfSkills} purpose="skills"/>
                        <div className="skillsLegend">
                            <div>1&nbsp;<BsStarFill/>&nbsp;Beginner&nbsp;&nbsp;&nbsp;</div>
                            <div>2&nbsp;<BsStarFill/>&nbsp;Average&nbsp;&nbsp;&nbsp;</div>
                            <div>3&nbsp;<BsStarFill/>&nbsp;Intermediate&nbsp;&nbsp;&nbsp;</div>
                            <div>4&nbsp;<BsStarFill/>&nbsp;Advanced&nbsp;&nbsp;&nbsp;</div>
                            <div>5&nbsp;<BsStarFill/>&nbsp;Expert</div>
                        </div>
                    </div>
                    <div className="skillsColumn ratingArea">
                        <h4>Top skills</h4>
                        <TopSkills list={listOfSkills} setSkillsBoxValidity={setSkillsBoxValidity} />
                    </div>
                </div>
                <div className="skillsColumns">
                    <div className="toolsRow">
                        <h4>Insert tools &amp; applications</h4>
                        <SkillsDropdown list={listOfTools} setList={setListOfTools} purpose="tools"/>
                        <SkillsList list={listOfTools} setList={setListOfTools} purpose="tools"/>
                    </div>
                </div>
            </div>
        </div>

    )
}
